import pandas as pd
import numpy as np
from datetime import date
from tkinter import filedialog, messagebox
import os

"""Takes NYBFCU customer data from an Excel file and outputs the data as a text file in a special format.
"OPA" returns a text file to the credit union with payroll amounts.
This data updates an Excel database and the program outputs a second text file for "FedComp."
Finally, a second "Winston" sheet is generated from the database.

PyInstaller command: python -m PyInstaller bravest.py --icon 'phoenix.ico' --onefile --noconsole
Requirements: pandas, pyinstaller, xlrd, xlwd, openpyxl
"""

db_name = "BravestDB.xlsx"

###1st Button: Edit EE sheet, allows for further edits###
def open_ee_sheet():
	"""Add members to EE spreadsheet"""
	infile = filedialog.askopenfilename()

	if "EmployeeElection" in infile:
		df = pd.read_excel(infile)
		#verify that sheet is being opened for the first time
		if df.columns[0] != 'ref_no':
			save_ee_formatted(df, infile) 

		os.system("start EXCEL.EXE " + '"'+infile+'"')

	else:
		messagebox.showerror("Error", "EmployeeElection_YYYYMMDD not found")


def save_ee_formatted(df, infile):
	"""Load ref no, amounts, and change/add option from .xls file into df then save over it."""
	df = df.iloc[:, [0,2,3,4,5]] #defaults to first sheet
	df = df.rename(columns={df.columns[0]: "ref_no", df.columns[1]: "first_name",
					df.columns[2]: "last_name", df.columns[3]: "winston", df.columns[4]: "start_date"})

	df["loan"], df["option"], df["note"] = float(), "C", str() #adds columns for user inputs
	df = df[["ref_no", "first_name", "last_name", "winston", "loan", "start_date", "option", "note"]]
	
	df.to_excel(infile, index=False)

