#################: Create OPA file (and save EE sheet to data)

def save_opa_file():
	"""Steps to carry out with EE file changes and adds."""
	ee_file = filedialog.askopenfilename()
	
	if "EmployeeElection" not in ee_file:
		messagebox.showerror("Error", "EmployeeElection_YYYYMMDD file not found")
	else:
		df = format_ee_dataframe(ee_file)
		df = df.dropna(subset=["ref_no"])

		#Update the database
		update_db_week1(df)

		#Combine rows into 90 character strings to meet unique guidelines.
		df.ref_no = df.ref_no.astype(int).astype(str).str.zfill(7)
		df.total = ["{:.2f}".format(x) for x in df.total]
		df.total = df.total.str.replace('.', '', regex=False).str.zfill(7)
		df["formatted"] = df.ref_no + "     F4587300" + df.ref_no + f"000000{date.today()}0571" +\
							df.option + f"{date.today()}605BM70009999-12-31000000" + df.total

		#save OPA file in folder with EE file
		today = str(date.today()).replace("-","")
		outfile = os.path.join(os.path.dirname(ee_file), f"PNET.BFCU.XDBFCU1{today}.txt")
		
		#Write it to a file and open it
		my_to_text(df.formatted, outfile)
		os.startfile(outfile)


def format_ee_dataframe(ee_file):
	"""Format the EE sheet for OPA file and updating the database."""
	df = pd.read_excel(ee_file)

	df.ref_no = df.ref_no.astype(float)
	df.option = df.option.str.upper().str.strip()
	df = df[df.option.isin(["C","A","W"])] #drop row if "change/add/withhold" not indicated
	df.loan = df.loan.astype(str).str.replace("$","", regex=False)
	df.winston = df.winston.astype(str).str.replace("$","", regex=False)
	df.loan, df.winston = df.loan.astype(float), df.winston.astype(float)

	df[['winston', 'loan']] = df[['winston', 'loan']].fillna(0)
	df['is_winston'] = 0
	df.is_winston[df.winston > 0] = 1
	df['total'] = np.round(df.winston + df.loan, 2)
	df = df.drop_duplicates(subset='ref_no', keep='last')

	return df


def my_to_text(df, outfile, first=True):
	'''Alternative to pd.to_csv, which adds an unwanted newline to the end.
		Newline must be CR-LF'''
	with open(outfile, 'w') as f:
		if outfile.endswith('FC.txt'): f.write('402:' + "\n")
		for member in df:
			if first:
				f.write(member)
				first = False
			else:
				f.write("\n" + member)
	
	messagebox.showinfo("Success", f"File saved as {outfile}")


def update_db_week1(df):
	"""Add members and amounts to database, week one.
		Try/except block is so an error doesn't stop the OPA text doc from being made."""
	try:
		dbase = pd.read_excel(db_name)
		dbase = dbase.dropna(subset=["ref_no"])
		seen_ref_nos = [x for x in df.ref_no.values if x in dbase.ref_no.values]
		adds = df.loc[~df.ref_no.isin(seen_ref_nos)]
		adds.note = adds.note.astype(str) #prevents merge error if EE sheet has no notes
		changes = df.loc[df.ref_no.isin(seen_ref_nos)]

		before_length = len(dbase)
		dbase.start_date = pd.to_datetime(dbase.start_date, errors='coerce').dt.date
		dbase = dbase.merge(adds, how='outer')
		dbase.index = dbase.ref_no
		changes.index = changes.ref_no
		
		dbase.update(changes)
		dbase.drop('option', axis=1, inplace=True)
		save_database(dbase)

		if len(dbase)-before_length > 0:
			messagebox.showinfo("Success",
				f"{len(dbase)-before_length} records added and {len(changes)} altered")

	except:
		messagebox.showerror("Error", "Database not updated")


def save_database(df):
	'''Outputs two-sheet Excel file with database and Winston members.'''
	df.start_date = pd.to_datetime(df.start_date, errors='coerce').dt.date
	df_winston = df[['ref_no','last_name','first_name',
						'mi', 'winston','from_opa',
						'loan','start_date','note']][df.is_winston == 1]

	df_winston.from_opa = df_winston.from_opa - df_winston.loan
	df_winston.drop("loan", axis=1, inplace=True)
	df_winston = df_winston.sort_values(by=["last_name", "first_name", "mi"])

	with pd.ExcelWriter(db_name) as writer:
		df.to_excel(writer, sheet_name=db_name, index=False)
		df_winston.to_excel(writer, sheet_name='winston-all', index=False)

