#################: Analyze OPA file

def analyze_opa():
	"""Differences between OPA file and database are identified and saved as an Excel file."""
	opa_file = filedialog.askopenfilename()

	if "PEDT" not in opa_file:
		messagebox.showerror("Error", "PEDT file not found")
	
	else:
		try:
			dbase = pd.read_excel(db_name)
		except:
			messagebox.showerror("Error", "Database not found")

		dbase, df_opa = update_db_week2(dbase, opa_file)

		df1 = totals_df(dbase)
		df2 = discrepancy_df(df_opa, dbase)
		table_name = f"analysis_{date.today()}.xlsx"

		with pd.ExcelWriter(table_name) as writer:
			df1.to_excel(writer, sheet_name='summary', index=True)
			df2.to_excel(writer, sheet_name='discrepancies', index=False)
		
		os.system("start EXCEL.EXE " + table_name)


def update_db_week2(dbase, opa_file):
	"""Load the new text file into a dataframe to update the database."""
	df = pd.read_csv(opa_file, names=['code'])

	df['ref_no'] = df.code.str[3:10].astype(int)
	df['last_name'] = df.code.str[11:26].str.strip()
	df['first_name'] = df.code.str[26:40].str.strip()
	df['option'] = df.code.str[67]
	df['from_opa'] = df.code.str[69:76].astype(int).astype(float)/100
	df['to_fedcomp'] = df.from_opa

	df.to_fedcomp[df.option == 'R'] = 0
	df = df.drop("code", axis=1)

	#Blackwell rule
	if 1104547 in df.ref_no.values:
		df.to_fedcomp[df.ref_no==1104547] = 0 #Mrs
		df.to_fedcomp[df.ref_no==1165096] += float(df.from_opa[df.ref_no==1104547]) #Mr

	df.index = df.ref_no
	dbase.index = dbase.ref_no
	dbase['from_opa'], dbase['to_fedcomp'], dbase['option'] = float(), float(), str()
	
	dbase.update(df)
	dbase = dbase.sort_values(by="last_name")
	save_database(dbase)

	return dbase, df


def totals_df(dbase):
	'''Return totals dataframe.'''
	winston = pd.read_excel(db_name, sheet_name=1)
	df = dbase[dbase.from_opa>0]
	db_total, opa_total = np.round(np.sum(df.total), 2), np.round(np.sum(df.to_fedcomp), 2)
	winston_total, db_winston = np.round(np.sum(winston.from_opa), 2), np.round(np.sum(dbase.winston), 2)
	
	return pd.DataFrame(data = {"In database": [db_total, db_winston],
								"From OPA": [opa_total, winston_total],
								"Difference": [db_total-opa_total, db_winston-winston_total]}, 
								index = ["Payroll", "Winston"])


def discrepancy_df(df, dbase):
	"""Return dataframe of unequal records."""
	lookat = dbase[np.round(dbase.total, 2) != np.round(dbase.to_fedcomp, 2)]
	lookat = lookat.sort_values(by='option', ascending=False)
	missing = df[df.index.isin(np.setdiff1d(df.ref_no, dbase.ref_no))]
	missing.drop('ref_no', axis=1, inplace=True)
	
	if len(missing) > 0:
		lookat = lookat.merge(missing, how='left')
	
	lookat.index = lookat.index.astype(int)
	lookat = lookat[['ref_no', 'first_name', 'last_name', 'total',
						'from_opa', 'to_fedcomp', 'option', 'note']]
	lookat.ref_no = lookat.ref_no.astype(int)
	lookat = lookat.sort_values(by="last_name")
	
	return lookat

