#################: Create FC file

def save_fedcomp_file():
	'''Loads the database and outputs FC.txt'''
	try:
		df = pd.read_excel(db_name)
	except:
		messagebox.showerror("Error", "Database not found")

	outfile =  os.path.join(os.getcwd(), 'FC.txt')

	#Combine rows into FedComp guidelines.
	df = df[['ref_no', 'mbr_no', 'to_fedcomp']][df.to_fedcomp > 0]
	df.mbr_no[df.mbr_no.isna()] = df.ref_no
	df.mbr_no = df.mbr_no.astype(int).astype(str).str.zfill(7)
	df.to_fedcomp = df.to_fedcomp.astype(str).str.rstrip('0').str.rstrip('.')
	df['formatted'] = df.mbr_no + ':' + df.to_fedcomp
	
	my_to_text(df.formatted, outfile)
	os.startfile(outfile)


def save_database_manually_changed():
	'''Outputs two-sheet Excel file with database and Winston members.'''
	try:
		df = pd.read_excel(db_name)
	except:
		messagebox.showerror("Error", "Database not found")

	save_database(df)
	os.system("start EXCEL.EXE " + db_name)


###GUI###
from tkinter import *
import base64
phoenix_icon = """"""
rockwell_logo = b''

app_title, app_version = "Bravest", "1.5.0"
w, h, w_in, h_down = 630, 430, 20, 20
b_width, b_height, padx, pady, bd = 20, 3, 12, 12, 8
bg, bg_alt, font = "red", "yellow", "Times 13"


def app_menu(master):
	def get_version():
		messagebox.showinfo(app_title, f"Version {app_version}")

	def open_directory():
		os.startfile(os.getcwd())

	menubar = Menu(master)
	filemenu, helpmenu = Menu(menubar, tearoff=0), Menu(menubar, tearoff=0)
	
	helpmenu.add_command(label="About", command=get_version)

	filemenu.add_command(label="Open database", command=save_database_manually_changed)
	filemenu.add_command(label="View containing folder", command=open_directory)
	filemenu.add_separator()
	filemenu.add_command(label="Quit", command=master.quit)
	
	menubar.add_cascade(label="File", menu=filemenu)
	menubar.add_cascade(label="Help", menu=helpmenu)
	
	master.config(menu=menubar)


def user_interface(master, center_img):
	master.title(app_title)
	master.geometry(f"{w}x{h}+{w_in}+{h_down}")
	master.minsize(w, h)
	image = Label(master, image=center_img,
				highlightbackground="red", highlightthickness=3)
	image.grid(row=0, column=1, columnspan=1, rowspan=4, padx=padx, pady=pady)
	
	add_button(master, open_ee_sheet, 2, 0,
				"Edit Employee\nElection sheet",
				"Select Employee\nElection Excel file")
	add_button(master, save_opa_file, 2, 1,
				"Create OPA file",
				"Select Employee\nElection Excel file")
	add_button(master, analyze_opa, 2, 2,
				"Analyze OPA return file",
				"Select OPA text file\n(PEDT...)")
	add_button(master, save_fedcomp_file, 2, 3,
				"Create FedComp file",
				"Create FedComp file")


def add_button(master, action, col, row, start_text, alt_text):
	"""Configure a button."""
	b1 = Button(master, text=start_text, width=b_width,
			height=b_height, bg=bg, bd=bd, command=action)
	b1.grid(column=col, row=row, padx=padx, pady=pady, sticky="nsew")
	b1.config(font=font)

	def on_enter(event):
		b1.configure(text=alt_text, bg=bg_alt)
	def on_leave(enter):
		b1.configure(text=start_text, bg=bg)

	b1.bind("<Enter>", on_enter)
	b1.bind("<Leave>", on_leave)


def add_icon(master):
	"""Pyinstaller needs a base64 image and tkinter needs it as a file."""
	icondata = base64.b64decode(phoenix_icon)
	tempfile = "icon.ico"
	iconfile = open(tempfile, "wb")
	iconfile.write(icondata) #extract the icon
	iconfile.close()
	master.wm_iconbitmap(tempfile)
	os.remove(tempfile) #delete the tempfile


if __name__ == '__main__':
	root = Tk()
	center_img = PhotoImage(data=rockwell_logo)
	add_icon(root)
	app_menu(root)
	user_interface(root, center_img)
	root.mainloop()